x; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(85, 85, 85); margin: 0px; font-size: 14px; border: 0px none; outline: none 0px; padding: 0px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">2. Bnh sinh nht dnh cho b yu</h3>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"><img alt="banh-sinh-nhat-cho-cac-be" height="261" src="http://thegioibanhkem.com.vn/profiles/thegioibanhkemcomvn/uploads/attach/1446524936_banhsinhnhatdanhchocacbe.png" style="box-sizing: border-box; border: 0px none; vertical-align: middle; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;" title="bnh sinh nht dnh cho cc b" width="400" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Sinh nht ca b yu th khng th khng c nhng chic bnh sinh nht ng nghnh ng , n lm cho b thch th, l mn n dinh dng dnh cho b v c gia nh. Nu l b gi th bn nn chn bnh c mu sc ti tn nh hng hay vng ,cam , ho tit trang tr hnh con vt, s tui ca b, hay l hnh bup b . Cn b trai th c bit hn thch nhng hnh t, siu nhn, bnh s tui ca b chn nhng gam mu ph hp nh xm , xanh da tri, mu </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"></p>\r\n\r\n<h3 style="box-sizing: border-box; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(85, 85, 85); margin: 0px; font-size: 14px; border: 0px none; outline: none 0px; padding: 0px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">3. Bnh sinh nht dnh cho ngi mnh yu</h3>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initia