g ny ca cung Bch Dng th a phn thch cc mn mn hn l bnh ngt. Bnh sinh nht nhanh v n gin chnh l s la chn u tin hng u ca cung ny.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">2. Cung Kim Ngu</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"><img alt="" height="374" src="http://thegioibanhkem.com.vn/profiles/thegioibanhkemcomvn/uploads/attach/1449290508_banhsinhnhatcungkimnguu.jpg" style="box-sizing: border-box; border: 0px; vertical-align: middle; margin: 0px auto; outline: none 0px; padding: 0px; display: block; background: none 0px 0px repeat scroll transparent;" title="banhsinhnhatcungkimnguu.jpg" width="450" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; backg