: 0px 0px; background-repeat: repeat;"><strong style="box-sizing: border-box; border: 0px none; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;"><img alt="bnh kem sinh nht r" height="225" src="http://thegioibanhkem.com.vn/profiles/thegioibanhkemcomvn/uploads/attach/1445657573_banhkemsinhnhatre.jpg" style="box-sizing: border-box; border: 0px none; vertical-align: middle; margin: 0px auto; outline: none 0px; padding: 0px; display: block; background: none 0px 0px repeat scroll transparent;" title="bnh kem sinh nht" width="300" /></strong></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Bi vit di y s l nhng bt m  cc bn c th hiu hn v nhng chic bnh p:</p>\r\n\r\n<h3 style="box-sizing: border-box; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(85, 85, 85); margin: 0px; font-size: 14px; border: 0px none; outline: none 0px; padding: 0px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"><strong style="box-sizing: border-box; border: 0px none; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;">1. Lch s ra i</strong></h3>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Xut hin trong vn ha phng Ty th<strong style="box-sizing: border-box; border: 0px none; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;"><a href="http://thegioibanhkem.com.vn/chi-tiet-bv/banh-kem-sinh-nhat.html" style="box-sizing: border-box; color: rgb(55, 139, 174); text-decoration: none; border: 0px none; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;">bnh kem</a></strong>tr thnh mn n khng th thiu dng trong cc ba tic sinh nht. Chic bnh thng l loi bnh xp mm cng vi hng v a thch, c trang tr ph hp vi ch ba tic.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Ngun gc ca nhng chic bnh bt ngun t thi c i xa xa, khi  hnh dng ca chic bnh  rt khc vi hnh dng ca nhng chic bnh ngy nay. Ban u bnh c mt ong v ht, qu kh hnh dng ging ht chic bnh m. Theo nh nh gi ca cc nh nghin cu m thc th chnh nhng ngi Hy Lp l nhng ngi u tin to ra cc k thut lm bnh.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"><img alt=" ngha ca bnh kem" height="199" src="http://thegioibanhkem.com.vn/profiles/thegioibanhkemcomvn/uploads/attach/1445657835_ynghiabanhkem.jpg" style="box-sizing: border-box; border: 0px none; vertical-align: middle; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;" title=" nghi bnh kem" width="300" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"><em style="box-sizing: border-box; border: 0px none; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;">Nhng chic bnh kem ngy nay c trang tr p mt hn</em></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"><em style="box-sizing: border-box; border: 0px none; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;"><img alt="bnh kem p r ti h ni" height="200" src="http://thegioibanhkem.com.vn/profiles/thegioibanhkemcomvn/uploads/attach/1445657961_banhkemdepre.jpg" style="box-sizing: border-box; border: 0px none; vertical-align: middle; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;" title="bnh kem p r" width="300" /></em></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"><em style="box-sizing: border-box; border: 0px none; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;">Hnh dng chic bnh cng ngy c thay i cho p mt</em></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Sau khi Chu u t c nhng thnh tu c bit trong k thut lm bnh th chic bnh c ci tin hn vi dng trn v ph y kem nh s pht trin trong cng ngh ch to.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Trc y lp kem c ph bn trn bnh c lm t hn hp un si gm ng, lng trng trng v hng v sau ny hng v cng nh dng v ca bnh c ci tin nh s dng bt m trng tinh luyn v vic dng bt nng thay cho bt  men.</p>\r\n\r\n<h3 style="box-sizing: border-box; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(85, 85, 85); margin: 0px; font-size: 14px; border: 0px none; outline: none 0px; padding: 0px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"><strong style="box-sizing: border-box; border: 0px none; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;">2. L do ti sao bnh kem li c hnh trn?</strong></h3>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Trc y hay n tn by gi th a s bnh sinh nht u c hnh trn. i vi cc hc gi th vic bnh sinh nht c hnh trn l do tn ngng tn gio v do k thut lm bnh nn hnh dng nh th, hnh trn ca bnh gn lin vi biu tng ca n thn Mt Trng-Artemis.  kin khc cho rng t thi c i ngi ta lm bnh hnh trn  biu trng cho vng quay thi gian qua cc nm. Ngy nay th ngi ta c th lm nhng chic bnh vi tht nhiu hnh dng v kch thc khc nhau.</p>\r\n\r\n<h3 style="box-sizing: border-box; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(85, 85, 85); margin: 0px; font-size: 14px; border: 0px none; outline: none 0px; padding: 0px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"><strong style="box-sizing: border-box; border: 0px none; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;">3.  ngha ca bnh kem</strong></h3>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Cng vi s pht trin ca nn m thc th s pht trin ca nhng chic bnh cng c pht trin hn. Vic c tng chic bnh gato trong dp sinh nht l mt iu rt  ngha v em n nhiu nim vui cho mi ngi, n khng ch th hin s quan tm m n cn th hin tnh yu thng km theo  l nhng li chc tt p.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">Hy n vi thegioibanhkem.com.vn  la chn cho mnh nhng mu<a href="http://thegioibanhkem.com.vn/chi-tiet-bv/banh-sinh-nhat-dep.html" style="box-sizing: border-box; color: rgb(55, 139, 174); text-decoration: none; border: 0px none; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;">banh sinh nhat</a>p v ph hp nht vi nhng ba tic ca bn!</p>\r\n', '', '', '', '', '', 4, 1, 1464947045, 1481557439, 0),
(112, 0, 0, 0, 0, 'tintuc', 1, 0, 'slider-8383.png', 'slider-8383_250x200.png', 'Nhng chic bnh sinh nht c o', '', 'nhung-chiec-banh-sinh-nhat-doc-dao', '', '', '', '', '', '', 'Nhng chic bnh sinh nht c o', 'Nhng chic bnh sinh nht c o', 'Nhng chic bnh sinh nht c o\r\n', 0, 0, 0, 0, '<p>i vi nhiu ngi th bnh sinh nht khng nht thit phi to v cu k quan trng l n phi c o l mt v n c th to c n tng cng nh ngi c tng c th cm nhn c nhng g m chic bnh mang li</p>\r\n', '<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;">i vi nhiu ngi th bnh sinh nht khng nht thit phi to v cu k quan trng l n phi c o l mt v n c th to c n tng cng nh ngi c tng c th cm nhn c nhng g m chic bnh mang li</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px; border: 0px none; font-size: 14px; outline: none 0px; padding: 0px; color: rgb(85, 85, 85); font-family: ''Times New Roman'', Times, serif; line-height: 20px; background-image: none; background-attachment: scroll; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0px 0px; background-repeat: repeat;"><a href="http://thegioibanhkem.com.vn/chi-tiet-bv/banh-kem-sinh-nhat.html" style="box-sizing: border-box; color: rgb(55, 139, 174); text-decoration: none; border: 0px none; margin: 0px; outline: none 0px; padding: 0px; background: none 0px 0px repeat scroll transparent;">Bnh kem</a>c xut pht t phng ty bi l mn trng ming khng th thiu ca mi gia nh nhng theo thi gian cng nh cng ngh pht trin nhiu loi bnh ra i vi nguyn liu chnh c s dng l kem c th l bnh sinh nht rt a dng v mt mu m v phong ph hn v mt nguyn liu c nhng chic bnh  tr thnh huyn thoi bi s sng to v c o khng km p