a></div>\r\n\r\n<div class="desc_cation">\r\n<p>Din vi&ecirc;n Vit Anh b&ecirc;n din vi&ecirc;n Trn Xu&acirc;n Tin. Vit Anh gi vai tr&ograve; nh&agrave; sn xut ki&ecirc;m ng bi&ecirc;n kch v&agrave; o din trong d &aacute;n phim.</p>\r\n</div>\r\n\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n\r\n<div class="item_slide_show" style="width: 75.7576%;">\r\n<div class="block_thumb_slide_show"><img alt="" class="left" css="" data-component-caption="&lt;p&gt;\r\n	Hoa hu i Dng ng Thu Tho tham gia mt vai trong phim.&lt;/p&gt;" data-reference-id="23045155" http:="" icons="" id="vne_slide_image_8" images="" js="" responsive="" slideshow="" src="http://c1.f9.img.vnecdn.net/2015/10/08/DSC-0706-2-1444323481_660x0.jpg" st.f1.vnecdn.net="" utils="" /> <a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n\r\n<div class="desc_cation">\r\n<p>Hoa hu i Dng ng Thu Tho tham gia mt vai trong phim.</p>\r\n</div>\r\n\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n\r\n<div class="item_slide_show" style="width: 75.7576%;">\r\n<div class="block_thumb_slide_show"><img alt="" class="left" css="" data-component-caption="&lt;p&gt;\r\n	Hoa khi Nguyn Th L Nam Em tham d s kin vi b vy m gi cm. nh: &lt;em&gt;Maison De Bil&lt;/em&gt;&lt;/p&gt;" data-reference-id="23045156" http:="" icons="" id="vne_slide_image_9" images="" js="" responsive="" slideshow="" src="http://c1.f12.img.vnecdn.net/2015/10/09/IMG-3550-1444325181_660x0.jpg" st.f1.vnecdn.net="" utils="" /> <a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n\r\n<div class="desc_cation">\r\n<p>Hoa kh&ocirc;i Nguyn Th L Nam Em tham d s kin vi b v&aacute;y &ocirc;m gi cm. nh: <em>Maison De Bil</em></p>\r\n</div>\r\n\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n', '', '', '', 1, 1, 1444356666, 1444875020, 0),
