(5, '', 'giaohang', '', '', '', '<dl class="accord">\r\n	<dd class="faq-content" style="display: block;">\r\n	<p>Trc khi gi li mt sn phm cho Lazada.vn  i tr hng, qu khch vui lng tham kho <a href="http://www.lazada.vn/helpcenter/returns-refunds/#answer-faq-returnpolicy-ans" target="_blank"><strong>Chnh sch i tr hng</strong></a> ca chng ti nhm m bo sn phm ny c  iu kin  hon tr.</p>\r\n\r\n	<p>Nu sn phm ca qu khch p ng tt c cc yu cu v i tr hng, vic i tr s c x l nhanh hn nu qu khch in vo <a href="http://www.lazada.vn/customer/order/index" target="_blank">Phiu ng k i tr hng trc tuyn</a>. Hoc qu khch cng c th in v s dng <a href="http://campaign.lazada.vn/static/ops/Return_Slip-A6.pdf" target="_blank">Phiu ng k i tr hng thng thng</a>.</p>\r\n	<img alt="" src="http://static.lazada.vn/cms/faq-screenshot/return-step-vn.png" />\r\n	<p>Sau khi in vo phiu ng k i tr, qu khch ch cn lm theo 3 bc n gin sau:</p>\r\n	<img alt="" src="http://static.lazada.vn/cms/faq-screenshot/return-step-vn-2.png" />\r\n	<p><br />\r\n	<strong>Lu </strong>:  m bo sn phm c hon tr v b phn kim tra cht lng hng i tr ca Lazada.vn m khng phi mt thm bt c chi ph vn chuyn no, qu khch vui lng gi sn phm v Lazada.vn bng mt trong hai m vn chuyn min ph sau theo a ch tng ng c ghi trn Phiu ng k i tr hng:</p>\r\n\r\n	<ul>\r\n		<li><strong>70C-0816-005SG</strong>  Kho Lazada.vn HCM (Cc bu gi t TP. Nng tr vo pha Nam): Kho xng 1-2, Cm 1, ng M14, KCN Tn Bnh m rng, phng Bnh Hng Ha, Q. Bnh Tn, TP. H Ch Minh</li>\r\n		<li><strong>10EMSC 1217 - 001TT</strong>  Lazada.vn HN (Cc bu gi t tnh Tha Thin Hu tr ra pha Bc): Kho Lazada.vn, l 2 ng c Lp, KCN H Bnh Phng, th trn Thng Tn, TP. H Ni</li>\r\n	</ul>\r\n\r\n	<p>Qu khch vui lng ng gi phiu ng k i tr v ton b sn phm, ph kin, qu tng (nu c) v cc giy t bao gm ha n, hng dn s dng, phiu bo hnh... vo bn trong thng hng  trnh tht lc. Qu khch c trch nhim v tnh ton vn ca hng ha khi gi v Lazada. Mi mt mt, h hng Lazada s khng chu trch nhim.</p>\r\n\r\n	<p>Qu khch nn chp nh sn phm trc khi i tr hng, vic lu gi hnh nh trong cc trng hp ny cng s gp phn gii quyt tt hn cc vn  pht sinh trong qu trnh i tr.</p>\r\n\r\n	<p>Ngoi ra, qu khch vui lng thng bo cho Lazada.vn trong vng 48 gi t lc nhn hng nu sn phm nhn c khng nguyn vn, mp, try xc, b v, hng c/  qua s dng hoc thiu cc linh kin cn thit.</p>\r\n\r\n	<p> c hng dn chi tit cc thao tc thc hin, qu khch vui lng tham kho ti <a href="http://www.lazada.vn/chinh-sach-doi-tra-hang/" target="_blank">y</a>. Ngoi ra, qu khch c th lin h b phn Chm sc khch hng ti <a href="http://www.lazada.vn/contact/" target="_blank">y</a>. Lazada.vn hn hnh phc v qu khch.</p>\r\n	</dd>\r\n	<dt id="faq-trackreturn-ans"><a><span>Lm th no  kim tra tnh trng i tr hng?</span></a></dt>\r\n	<dd class="faq-content" style="display: block;">\r\n	<p>Ngay khi gi sn phm v cho Lazada.vn qua bu cc VNPost, qu khch vui lng lu li s hiu bu gi (m vn n)  c th tra cu hnh trnh kin hng gi tr ti <a href="http://www.vnpost.vn" target="_blank">www.vnpost.vn</a></p>\r\n\r\n	<p>Sau khi sn phm ca qu khch c gi v n kho, chng ti s tin hnh kim tra nh gi cht lng sn phm v thi gian  hon tt qui trnh ny cn 3-5 ngy lm vic. Ngay sau khi c kt qu kim tra, chng ti s gi thng bo n qu khch qua in thoi, tin nhn hoc email.</p>\r\n\r\n	<p>Sau khi nhn c thng bo, qu khch c th s dng cng c tra cu n hng trc tuyn ca Lazada.vn ti <a href="http://www.lazada.vn/kiem-tra-don-hang" target="_blank">www.lazada.vn/kiem-tra-don-hang</a>  kim tra tnh trng i hng hoc hon tin (qu khch cn ng nhp vo ti khon, v chn n hng qu khch  kch hot chc nng i tr).</p>\r\n	</dd>\r\n	<dt id="faq-qualityevaluation-ans"><a><span>Sau bao lu ti c th nhn c kt qu i tr hng ca ti?</span></a></dt>\r\n	<dd class="faq-content" style="display: block;">\r\n	<p>Quy trnh nh gi cht lng sn phm ny c th cn khong 5 ngy lm vic tnh t thi im Lazada.vn nhn c sn phm gi tr ti kho. Sau  qu khch s nhn c email thng bo kt qu kim tra nh gi sn phm.</p>\r\n\r\n	<p>Vic gi sn phm thay th hoc hon tin ch c bt u sau khi Lazada.vn  nhn y  thng tin xc nhn t khch hng.</p>\r\n	</dd>\r\n	<dt id="faq-returnshipmentcost-ans"><a><span>Lazada.vn c thanh ton tin ph vn chuyn cho sn phm i tr?</span></a></dt>\r\n	<dd class="faq-content" style="display: block;">\r\n	<p>Qu khch s c min ph vn chuyn khi gi li sn phm i tr cho Lazada.vn qua bu in Vnpost bng mt trong hai m vn chuyn min ph <strong>70C-0816-005SG</strong>  Kho Lazada.vn HCM hoc <strong>10EMSC 1217 - 001TT</strong>  kho Lazada.vn H Ni theo a ch c ghi trn Phiu ng k i tr hng. Lazada.vn hin cha h tr chi ph vn chuyn nu qu khch gi hng thng qua cc n v vn chuyn khc.</p>\r\n\r\n	<p><strong>Lu </strong>: Cc m bu gi ch ap dung i vi bu cuc VNPost (VNPT c). Nu qu khch gp bt c tr ngi no trong vic gi hng qua bu cc VNPost, vui lng lin h s in thoi H tr ca Bu cc tng (08) 3827 0999</p>\r\n	</dd>\r\n	<dt id="faq-qualityevaluation-ans"><a><span>Sau khi ti thc hin yu cu i tr hng trc tuyn, s c ngi n tn nh nhn li hng ca ti phi khng?</span></a></dt>\r\n	<dd class="faq-content" style="display: block;">\r\n	<p>Vic qu khch thc hin yu cu i tr hng trc tuyn trn website ch l bc Lazada.vn ghi nhn li thng tin v sn phm qu khch mun i tr v hng x l mong mun. Qu khch vn cn phi ng gi v gi sn phm v Lazada.vn  c h tr x l cc bc tip theo. Chi tit v thao tc ng k i tr hng trc tuyn, qu khch tham kho ti <a href="http://www.lazada.vn/huong-dan-tra-hang-truc-tuyen/" target="_blank">www.lazada.vn/huong-dan-tra-hang-truc-tuyen/</a></p>\r\n	</dd>\r\n	<dt id="faq-qualityevaluation-ans"><a><span>Lm sao  ti bit c ti  thc hin thnh cng yu cu i tr hng trc tuyn?</span></a></dt>\r\n	<dd class="faq-content" style="display: block;">\r\n	<p>Sau khi qu khch hon tt cc bc in thng tin ti biu mu <strong>Yu cu i tr hng trc tuyn</strong>, mn hnh giao din trn website s hin th thng bo v yu cu i tr ca qu khch  c cp nht thnh cng.</p>\r\n	</dd>\r\n	<dt id="faq-qualityevaluation-ans"><a><span>Sau bao lu k t lc gi yu cu i tr hng trc tuyn ti s nhn c phn hi?</span></a></dt>\r\n	<dd class="faq-content" style="display: block;">\r\n	<p>Vic gi yu cu i tr hng trc tuyn l bc u tin ca quy trnh i tr. Vic gi sn phm thay th hoc hon tin ch c bt u sau khi chng ti  nhn sn phm qu khch gi v ti kho v hon tt vic kim tra nh gi tnh trng sn phm. Quy trnh nh gi cht lng sn phm ny c th cn khong 5 ngy lm vic tnh t thi im Lazada.vn nhn c sn phm gi tr ti kho.</p>\r\n	</dd>\r\n	<dt id="faq-qualityevaluation-ans"><a><span>Ti c th va thc hin yu cu i tr hng trc tuyn va mang sn phm n i tr ti cc Vn phng ca Lazada.vn khng?</span></a></dt>\r\n	<dd class="faq-content" style="display: block;">\r\n	<p>Qu khch hon ton c th mang sn phm n cc Vn vn phng Lazada.vn  TP.HCM, H Ni v mt s tnh/ thnh ph sau  i tr, sau khi thc hin yu cung k i tr hng trc tuyn trn website.</p>\r\n\r\n	<p><strong>Lu </strong>: Thi gian phc v: T 9:30 - 17:30 cc ngy t th 2 n th 7 (khng lm vic vo ch nht v cc ngy l Tt)</p>\r\n\r\n	<p><b>i vi khch hng ti TP. H Ch Minh:</b> Vn phng: 236/12/11 in Bin Ph, phng 17, qun Bnh Thnh, TPHCM</p>\r\n\r\n	<p><b>Vn phng ti Th c:</b> 238/7 Hong Diu 2, phng Linh Chiu, qun Th c, TPHCM.</p>\r\n\r\n	<p><b>Vn phng ti H Ni:</b>Kho Lazada.vn, l 2 ng c Lp, KCN H Bnh Phng, th trn Thng Tn, Tp. H Ni</p>\r\n\r\n	<p><b>Vn phng ti Hi Phng:</b> S 119 L 26D L Hng Phng, Qun Ng Quyn, thnh ph Hi Phng.</p>\r\n\r\n	<p><b>Vn phng ti  Nng:</b> 24 K ng, phng Xun H, qun Thanh Kh,  Nng.</p>\r\n\r\n	<p><b>Vn phng ti Nha Trang:</b> 38B Trn Nht Dut, phng Phc Ha, thnh ph Nha Trang.</p>\r\n\r\n	<p><b>Vn phng ti Bin Ha:</b> 49 Hng o Vng, khu ph 1, phng Quyt Thng, thnh ph Bin Ha, tnh ng Nai</p>\r\n\r\n	<p><b>Vn phng ti Cn Th:</b> 79 Nguyn , phng An Ha, qun Ninh Kiu, thnh ph Cn Th.</p>\r\n\r\n	<p><b>Vn phng ti Bun M Thut:</b> 88 Trn Hng , Phng T An, Thnh ph Bun Ma Thut, Tnh Daklak.</p>\r\n\r\n	<p><b>Vn phng ti Bnh Dng:</b> 29 ng D35 khu dn c Vit Sing, An Ph, Thun An , Bnh Dng.</p>\r\n\r\n	<p><b>Vn phng ti Hu:</b> 118 Phan Chu Trinh, P. Phc Vnh, thnh ph Hu, tnh Tha Thin Hu.</p>\r\n\r\n	<p><b>Vn phng ti Vng Tu:</b> 140 Phm Hng Thi, phng 7, thnh ph Vng Tu, tnh B Ra-Vng Tu.</p>\r\n	</dd>\r\n</dl>\r\n', '', '', '', '', '', '', '', '', 1, 0, 1445594723, 0),
