(3, '', 'tuyendung', '', '', '', '<p class="Normal">V&agrave;o s&acirc;n vi i h&igrave;nh gn nh mnh nht, c thoi m&aacute;i chim u th trc ch nh&agrave; Ireland. Nhng iu g&acirc;y tht vng l&agrave; c&aacute;c cu th mang danh ng kim v&ocirc; ch World Cup li&ecirc;n tc b l c hi.</p>\r\n\r\n<p class="Normal">Ozil, Gundogan v&agrave; Reus c&oacute; ba t&igrave;nh hung dt im t v tr&iacute; trng tri trc khung th&agrave;nh th m&ocirc;n Shay Given, nhng u kh&ocirc;ng ho&agrave;n th&agrave;nh nhim v. Ng&ocirc;i sao ca CLB Arsenal cng c&oacute; mt ln a b&oacute;ng v&agrave;o li Ireland, nhng kh&ocirc;ng c c&ocirc;ng nhn b&agrave;n thng do li vit v.</p>\r\n', '', '', '', 'Tuyn nhn vin', 'Tuyn nhn vin,Tuyn nhn vin,Tuyn nhn vin', 'Tuyn nhn vin,Tuyn nhn vin,Tuyn nhn vin,Tuyn nhn vin', '', '', 1, 0, 1444362420, 0),
