(9, '', 'trangchu', 'Dich v ca cng ty chng ti', 'dich-vu-cua-cong-ty-chung-toi', '', '<p>CNG TY TNHH T VN THIT K XY DNG PHC HUY c thnh lp vo u nm 2008.T khi thnh lp n nay, Cng ty chng ti  thc hin trn 100 cng trnh dn dng, cng nghip trn khp c nc v  to c s tin cy ca cc ch u t. iu   lm nn uy tn ca CNG TY TNHH T VN THIT K XY DNG PHC HUY hm nay.<br />\r\nVi phng chm:  cao cht lng, gi c hp l, sn sng hp tc vi tt c cc i tc.... nguyn tc bnh ng cng c li.    </p>\r\n', '', '', '', '', '', '', 'gioithieu-1936.png', 'gioithieu-1936_590x260.png', 0, 0, 1453187783, 1457758887),
(10, '', 'dichvu_t', 'MI TH TT CHO KHCH HNG', 'moi-thu-tot-cho-khach-hang', '', '<p style="text-align: center;">Phan Nguyn t ho l ni c la chn  chuyn ti yu thng v lu gi nhng khonh khc ngt ngo, thng hoa ca nhng i tim yu  tm thy nhau. Gia nhng khung nh, cm xc nh c lng ng.</p>\r\n', '', '', '', '', '', '', '', '', 1, 0, 1453258098, 0),
(11, '', 'aocuoi', '', '', '', '<p style="text-align: center;">Hin nay, thay v tm n cc dch v <a href="http://www.aocuoigiasi.com">cho thu o ci</a>, cc c du thng c xu hng t may 1 b o</p>\r\n\r\n<p style="text-align: center;">ci cho ring mnh. Nh vy va p ng c s thch ca mnh, va c th gi li vt k nim cho</p>\r\n\r\n<p style="text-align: center;">ngy trng i nht ca i mnh. Nhng  tm c mt dch v may o ci p  TPHCM ph hp</p>\r\n\r\n<p style="text-align: center;">vi nhu cu ca mnh l mt vic khng h n gin. Cc bn thng gp kh khn trong vic tm cc</p>\r\n\r\n<p style="text-align: center;">ca hng may o ci p vi gi thnh hp l bi v cc ca hng ln u c gi may o ci kh cao.</p>\r\n\r\n<p style="text-align: center;">o Ci Hng Anh s gii quyt nhng ni lo lng  gip bn. Vi nhiu nm kinh nghim trong ngnh,</p>\r\n\r\n<p style="text-align: center;">chng ti t tin s mang n cho bn nhng b oci mi p nht vi gi thnh hp l nht.</p>\r\n\r\n<p style="text-align: center;">Nhng l do m bn nn chn <a href="http://www.aocuoigiasi.com">o ci</a> Hng Anh ca chng ti :</p>\r\n\r\n<p style="text-align: center;">- L mt trong nhng trung tm mua bn, nhn t may o ci, veston ln nht ti TPHCM.</p>\r\n\r\n<p style="text-align: center;">- Chuyn cung cp o ci p cho cc studio o ci ti cc tnh thnh trn c nc.</p>\r\n\r\n<p style="text-align: center;">- Ta lc ti v tr c a nht ti trung tm mua bn o ci  Si Gn, khng gian sang trng,</p>\r\n\r\n<p style="text-align: center;">hin i</p>\r\n\r\n<p style="text-align: center;">- C xng may ring, v vy gi thnh lun r nht</p>\r\n\r\n<p style="text-align: center;">- Lun cp nhp cc mu m hin i v thi trang nht trn th gii</p>\r\n\r\n<p style="text-align: center;">- Cung cp dch v may o ci theo catalog mi nht, p ng c mi nhu cu ca c du</p>\r\n\r\n<p style="text-align: center;">- c bit, chng ti cn nhn thit k v may o ci theo yu cu ca cc studio, nhn xut</p>\r\n\r\n<p style="text-align: center;">khu o ci nhiu nc trn th gii</p>\r\n\r\n<p style="text-align: center;">- Thit k o ci theo yu cu c du , gi c hp l nht .</p>\r\n\r\n<p style="text-align: center;">Nu bn ang c d nh m mt studio hoc ca hng o ci v ang cn tm a ch may o ci</p>\r\n\r\n<p style="text-align: center;">p gi s  TPHCM th hy ngay lp tc lin lc vi chng ti  nhn c s h tr v t vn sm</p>\r\n\r\n<p style="text-align: center;">nht nh. o ci Hng Anh tin chc s l tr thnh mt i tc uy tn ca bn.</p>\r\n\r\n<p style="text-align: center;">Vi nhng u im trn, chng ti tin chc s l mt trong nhng a ch may o ci p ti TPHCM</p>\r\n\r\n<p style="text-align: center;">m bn ang tm kim. Hy la chn o ci Hng Anh v  chng ti lm bn hi lng.</p>\r\n\r\n<p style="text-align: center;">Thng tin lin lc :</p>\r\n\r\n<p style="text-align: center;">Xng may o ci Hng Anh</p>\r\n\r\n<p style="text-align: center;">Nhn may o ci gi r theo cataluge nc ngoi 2014 . Thi gian hon thnh sn phm nhanh, m bo ng theo s o .</p>\r\n\r\n<p style="text-align: center;">Nhng mu o ci mi nht theo cataluge 2014 : <a href="http://aocuoigiasi.com/may-ao-cuoi-scpo">http://aocuoigiasi.com/may-ao-cuoi-scpo</a></p>\r\n\r\n<p style="text-align: center;">Cam kt gi cnh tranh nht ti Si Gn .</p>\r\n\r\n<p style="text-align: center;">- a ch: 444 L Thng Kit , P.7 , Q.TB ( i din ch Tn Bnh )</p>\r\n\r\n<p style="text-align: center;">- in thoi : 0906.762.766 - 08.35030175 (Ms.Tho)</p>\r\n\r\n<p style="text-align: center;"></p>\r\n\r\n<p style="text-align:center"><img alt="" src="http://aocuoigiasi.com/multidata/imagephp-259.jpg" style="width: 418px; height: 532px;" /></p>\r\n', '', '', '', '', '', '', 'mauvaycuoimuathu2012-5-7289.jpg', 'mauvaycuoimuathu2012-5-7289_375x495.jpg', 0, 0, 1453272792, 1453434893),
(12, '', 'hinhanh', 'LU LI TNG KHONH KHC', 'luu-lai-tung-khoanh-khac', '', '<p style="text-align: center;">Hnh ci l nhng hnh trnh tm kim cm xc thng hoa ca Tnh yu. V chng ti l ngi c nhim v lu li nhng cm xc y mt cch chn thc nht. Cc bn c Tnh Yu, chng ti c am m, tt c s lm nn nhng iu k diu.</p>\r\n', '', '', '', '', '', '', '', '', 1, 0, 1453280925, 0),
(13, '', 'chamsoc', '', '', '', '<p dir="ltr" id="docs-internal-guid-f2760a11-9fc3-99a9-9a35-8e04de6864d1" style="line-height:1.2;margin-top:0pt;margin-bottom:0pt;text-align: justify;"><span style="font-size:20px;"><span style="font-family: comic sans ms,cursive;"><big><span style="color: rgb(255, 0, 0);"><strong><span style="background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Ca hng  chi E</span></strong></span></big></span></span></p>\r\n\r\n<p dir="ltr" style="line-height:1.2;margin-top:0pt;margin-bottom:0pt;text-align: justify;"></p>\r\n\r\n<p dir="ltr" style="line-height:1.2;margin-top:0pt;margin-bottom:0pt;text-align: justify;"><span style="font-size:16px;"><span background-color:="" color:="" font-style:="" font-variant:="" font-weight:="" new="" text-decoration:="" times="" vertical-align:="">Hotline: </span><span style="color: rgb(255, 0, 0);"><span background-color:="" font-style:="" font-variant:="" font-weight:="" new="" text-decoration:="" times="" vertical-align:="">0909.525.595</span></span><span background-color:="" color:="" font-style:="" font-variant:="" font-weight:="" new="" text-decoration:="" times="" vertical-align:=""> - Mr. Tun</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span background-color:="" color:="" font-style:="" font-variant:="" font-weight:="" new="" text-decoration:="" times="" vertical-align:="">a ch: 410/15B Cch Mng Thng 8</span></span></p>\r\n', '', '', '', '', '', '', '', '', 0, 0, 1453965517, 1454379644),
(15, '', 'slogan', '', '', '', '<p style="text-align: center;"><span style="font-size:20px;"><span style="color:#0076a3;"><img alt="" height="29" src="http://localhost/hoangnhu/upload/images/slogan1.png" width="32" />C Kh My Xy Dng Ninh Tun ip</span> vi th mnh v kinh nghim, sn phm v dch v do chng ti cung cp c</span></p>\r\n\r\n<p style="text-align: center;"><span style="font-size:20px;">cht lng</span><span style="font-size: 20px; line-height: 1.6;">tt m bo theo yu cu k thut, gi c hp l. Chng ti chuyn cung cp cc sn phm</span><span style="font-size: 20px; line-height: 1.6;">c in,</span></p>\r\n\r\n<p style="text-align: center;"><span style="font-size: 20px; line-height: 1.6;">my xy dng v sa cha bo tr</span><span style="font-size: 20px; line-height: 1.6;">cc thit b lin h.</span><span style="line-height: 1.6;"></span><span style="font-size: 20px; line-height: 1.6;"><img alt="" height="29" src="http://localhost/hoangnhu/upload/images/slogan2.png" width="32" /></span><span style="line-height: 1.6;"></span></p>\r\n', '', '', '', '', '', '', '', '', 0, 0, 1460017547, 1460018778),
